import React from 'react'

const Home = () => {
  const userName = JSON.parse( localStorage.getItem('user'));
  return (
   <>
   <h3>HomePage</h3>
   <p>Welcome {userName.username}</p>
   <button >Logout</button>
   </>
  )
}

export default Home
